import './style.css';

const ProjectItem = (data) => {
    return (
        <li className="project">
            <a href={"./project-page.html"}>
                <img src={data.img} alt="Project img" className="project__img" />
                <h3 className="project__title">{data.title}</h3>
            </a>
        </li>
    );
}
 
export default ProjectItem;
